INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (2, 1, 1000, 2, "調子が上がって\nきたなっ", "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_2_002_001", 3000, "vo_minigame_1013_icon_1_002_001", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (2, 2, 5000, 2, "ほらほら、\nまだいけるだろ？", "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_2_003_001", 3000, "vo_minigame_1013_icon_1_003_001", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (2, 3, 10000, 3, "へへっ、おまえら\nやるじゃねえか！", "すばらしい\n記録ですわ", "vo_minigame_1013_icon_2_004_001", 3000, "vo_minigame_1013_icon_1_004_001", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3, 4, 10000, 3, "あたしたちはまだ\n止まらねえぜ！", "乗りに乗って\nいますわね", "vo_minigame_1013_icon_2_005_001", 3000, "vo_minigame_1013_icon_1_005_001", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3, 5, 10000, 3, "見てろよ！\nマコト班の快進撃だ！", "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_2_005_002", 3000, "vo_minigame_1013_icon_1_005_002", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (3, 6, 10000, 3, "うおぉぉっ！\n絶好調だぜ！", "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_2_005_003", 3000, "vo_minigame_1013_icon_1_005_003", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (4, 7, 0, 3, "どこまで行けるか\n楽しみだなっ！", "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_2_006_001", 3000, "vo_minigame_1013_icon_1_006_001", 2);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (5, 8, 1, 4, "まだ諦めんなよっ", "厄介でしたわ…", "vo_minigame_1013_icon_2_007_001", 1000, "vo_minigame_1013_icon_1_007_001", 3);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (5, 9, 1, 4, "冷やっとしたぜ…！", "油断大敵です", "vo_minigame_1013_icon_2_007_002", 1000, "vo_minigame_1013_icon_1_007_002", 3);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (5, 10, 1, 4, "弱音を吐くなっ", "忌々しいっ…", "vo_minigame_1013_icon_2_007_003", 1000, "vo_minigame_1013_icon_1_007_003", 3);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (6, 11, 99, 3, "マコト班集合！", "大所帯ですわね", "vo_minigame_1013_icon_2_008_001", 1500, "vo_minigame_1013_icon_1_008_001", 4);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (6, 12, 99, 3, "連携してくぞ！", "エリコ班へようこそ", "vo_minigame_1013_icon_2_008_002", 1500, "vo_minigame_1013_icon_1_008_002", 4);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (8, 13, 0, 6, "みんなに力を！", "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_2_020_001", 3000, "vo_minigame_1013_icon_1_020_001", 1);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (9, 14, 0, 7, "任せてくれたまえ", "はっはっは！\n任せろ！", "vo_minigame_1013_icon_2_022_001", 3000, "vo_minigame_1013_icon_1_022_001", 1);
INSERT INTO `v1_ef2dd926f20118011ec0f375dee8f511a6bf040aab078b21aa6afa07ee326fb5` VALUES (10, 15, 0, 8, "ほな、いきまひょか", "どんどんいくわよ", "vo_minigame_1013_icon_2_023_001", 3000, "vo_minigame_1013_icon_1_023_001", 1);
